// ==UserScript==
// @name         juju云仓小助手
// @namespace    https://example.com
// @version      1.4
// @description  设置设置收货地址和店铺
// @match        *://*.*.quezhongzhuan.com/*
// @match        *://*.quezhongzhuan.com/*
// @grant        GM_getValue
// @grant        GM_setValue
// @grant        GM_registerMenuCommand
// @icon        data:image/jpeg;base64,
// @downloadURL https://update.greasyfork.org/scripts/530360/juju%E4%BA%91%E4%BB%93%E5%B0%8F%E5%8A%A9%E6%89%8B.user.js
// @updateURL https://update.greasyfork.org/scripts/530360/juju%E4%BA%91%E4%BB%93%E5%B0%8F%E5%8A%A9%E6%89%8B.meta.js
// ==/UserScript==
(function() {
    'use strict';
    console.log('juju云仓小助手已启动');
    const DEFAULT_TEXT = '';
    const DEFAULT_SUFFIX = '';


    function getOrderNumber() {

        const layerDiv = document.querySelector('div.layui-layer.layui-layer-page.layer-anim');
        if (layerDiv) {
            const copyIcon = layerDiv.querySelector('i.copyTradeOrder[title="点击复制订单号"]');
            if (copyIcon) {
                const orderNum = copyIcon.getAttribute('data');
                console.log('订单号:', orderNum);
                return orderNum;
            } else {
                console.log('未找到 i 元素，class=copyTradeOrder 且 title=点击复制订单号');
            }
        } else {
            console.log('未找到 div.layui-layer.layui-layer-page.layer-anim');
        }
        console.warn("⚠️ 未找到订单号！");
        return null;

    }
    GM_registerMenuCommand('设置收货地址', () => {
        const current = GM_getValue('customAddress', DEFAULT_TEXT) || '';
        const newVal = prompt('请输入新的收货地址前缀：', current);
        if (newVal !== null) {
            GM_setValue('customAddress', newVal.trim());
        }
    });

    GM_registerMenuCommand('设置店铺名', () => {
        const storeName = GM_getValue('storeName', DEFAULT_TEXT) || '';
        const newVal = prompt('输入店铺：', storeName);
        if (newVal !== null) {
            GM_setValue('storeName', newVal.trim());
        }
    });

    let MY_CUSTOM_TEXT = GM_getValue('customAddress', DEFAULT_TEXT);
    let STORE_SUFFIX = GM_getValue('storeName', DEFAULT_SUFFIX);
    let observer = new MutationObserver(function(mutations){
        fixTextareaRepeatedly();
    });
    observer.observe(document.documentElement, { childList: true, subtree: true });
    function fixTextareaRepeatedly() {
        const textareas = document.querySelectorAll('textarea[id^="orderReceiverAddress_"]');
        if (!textareas.length) return;

        let orderNum = getOrderNumber(); // 获取订单号
        if (!orderNum) {
            console.warn("未找到订单号");
            return;
        }
        let repeatCount = 3;
        let times = 0;

        let timer = setInterval(() => {
            times++;
            textareas.forEach(ta => {
                let wantVal = MY_CUSTOM_TEXT + '(' + orderNum + ')['+STORE_SUFFIX+']';
                if (ta.value !== wantVal) {
                    ta.value = wantVal;
                }
            });

            if (times >= repeatCount) {
                clearInterval(timer);
            }
        }, 500);
    }

})();
